```solidity
pragma solidity ^0.5.0;

contract Contract {

    mapping (address => uint) balances;
    mapping (bytes32 => Confirmation) confirmations;
    mapping (address => Owner) owners;
    mapping (bytes32 => Transaction) transactions;

    struct Confirmation {
        address sender;
        bool confirmed;
    }

    struct Owner {
        address ownerAddress;
        uint ownerID;
    }

    struct Transaction {
        address destination;
        uint value;
        bytes data;
    }

    function removeOwner(address _owner) public {
        require(balances[msg.sender] > 0);
        require(balances[_owner] > 0);

        balances[_owner] = 0;

        emit OwnerRemoved(_owner);
    }

    function addOwner(address _owner) public {
        require(balances[msg.sender] > 0);
        require(balances[_owner] == 0);

        balances[_owner] = 1;

        emit OwnerAdded(_owner);
    }

    function execute(address _to, uint _value, bytes memory _data) public returns (bytes32 _r) {
        require(balances[msg.sender] > 0);

        _r = keccak256(abi.encodePacked(_to, _value, _data, block.number));

        Transaction memory t = Transaction({
            destination: _to,
            value: _value,
            data: _data
        });

        transactions[_r] = t;

        emit ExecutionRequested(_r, _to, _value, _data);
    }

    function confirm(bytes32 _h) public returns (bool _r) {
        require(balances[msg.sender] > 0);
        require(transactions[_h].destination != address(0));
        require(confirmations[_h].sender != msg.sender);

        confirmations[_h] = Confirmation({sender: msg.sender, confirmed: true});

        emit Confirmed(_h);

        executeConfirmedTransaction(_h);

        _r = true;
    }

    function executeConfirmedTransaction(bytes32 _h) internal {
        Transaction memory t = transactions[_h];

        if (confirmations[_h].confirmed) {
            (bool success,) = t.destination.call.value(t.value)(t.data);
            if (success) emit Executed(_h);
            else emit ExecutionFailed(_h);
        }
    }

    // Events
    event OwnerAdded(address indexed owner);
    event OwnerRemoved(address indexed owner);
    event ExecutionRequested(bytes32 indexed executionId, address indexed to, uint256 indexed value, bytes data);
    event Confirmed(bytes32 indexed executionId);
    event Executed(bytes32 indexed executionId);
    event ExecutionFailed(bytes32 indexed executionId);
}
```
The contract allows for adding and removing owners based on their address. It also allows for the execution of transactions, with these transactions being confirmed by the sender. The contract emits events for significant actions such as addition and removal of owners, execution requests, confirmations, executions, and execution failures.

